import React from 'react';


function PostList({ posts, pickedCategory }) {



    return (
        <div className="App">
            {posts.map(post => {
                if (pickedCategory === "") (
                    <p>{post.name}</p>
                )
            })}
        </div>
    );
}

export default PostList;
